script: |
  super -f text -I q3560.spq | sort > q3560.out

inputs:
  - name: q3560.spq
    data: |
      SELECT DISTINCT + 84 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 * + 99 NOT BETWEEN NULL AND - + col0 * + col0 * + col0 + + col2 / 32 - + 63;
  - name: tab1

outputs:
  - name: q3560.out
    data: |
